script: |
  super -f text -I q654.spq | sort > q654.out

inputs:
  - name: q654.spq
    data: |
      SELECT DISTINCT 72 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - col1 + + col0 * col0 NOT BETWEEN ( 95 + - 3 ) AND 21 + CAST ( + 37 AS INTEGER );
  - name: tab1

outputs:
  - name: q654.out
    data: |
